import React, {Component} from "react"



class App extends Component{

    constructor(){
        super()
        this.state = {
            number: 0,

        }
    }

    eventHandler(){
        console.log("test")
    }



    render(){
        return(
            <div>
                <h1>{this.state.number}</h1>
                <button className="btn btn-primary">Click Me!</button>
            </div>
        )
    }
}


export default App
